package test;

import static org.junit.jupiter.api.Assertions.*;

import org.junit.jupiter.api.Test;
import arbolito.SuffixTree;
class SuffixTreeTest {

	@Test
	void test() {
		SuffixTree st1 = new SuffixTree("abacabadacaba");
		assertTrue(st1.checkSuffixTree());
		SuffixTree st2 = new SuffixTree("el zorro rorro es muy porro pero le gusta subir el morro desde cachorro con su chaqueta de chiporro");
		assertTrue(st2.checkSuffixTree());
		SuffixTree stressTest = new SuffixTree("");
		assertTrue(stressTest.checkSuffixTree());
	}

}
